import React from "react";

function SkillCard(props) {
  const frontend = ['JavaScript','React/Redux','HTML','CSS','Bootstrap','SemanticUI'];
  const backend = ['Python', 'Django', 'AWS', 'PostgreSQL'];
    const tool = ['Unity','Phaser','PyGame'];

  return (
    <>
        <div className="col-md-4 col-sm-12">
          <div className="skills-wrapper__card">
          <h3>{props.title}</h3>

          <div className="skills-wrapper__box">
          {props.skills.map((skill, key)=>(
                <div key={key} className="col skills-wrapper__image">
                  <img
                    src={require(`../images/logo/128px-${skill}.png`)}
                    alt="JavaScript Logo"
                  />
                  {/* <span>{skill}</span> */}
                </div>
            ))} 
            </div>
          </div>
        </div>
    </>
  );
}

export default SkillCard;
